import style from './styles.scss';

export default class Navigation extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <div className={`${style.Navigation} ${classes}`}>
        <a href='/#about' onClick={this.props.handleToggleMenu}>
          About
        </a>
        <a href='/#latest-work' onClick={this.props.handleToggleMenu}>
          Latest Work
        </a>
        <a href='/#tech-stack' onClick={this.props.handleToggleMenu}>
          Tech Stack
        </a>
        <a href='/#contact' onClick={this.props.handleToggleMenu}>
          Contact
        </a>
      </div>
    );
  }
}
